import React from 'react'

const PlayerCard = (data) => {
    // console.log(data);
    
  return (
    <div>{
    data.map((item)=>{
        return (
            <div className="player-card">
                <img src={item.img} alt="" />
                <h3>{item.name}</h3>
                <p>{item.statistics}</p>
            </div>
        )
    })
    }
       
    </div>
  )
}

export default PlayerCard
